import React from "react";
import { Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
    <Segment inverted>
      <Menu fixed='top' inverted secondary>
        <Menu.Item name="home" />
        <Menu.Item name="messages" />
        <Menu.Item name="friends" />
      </Menu>
    </Segment>
  );
};
